  return (
    <Fragment>
      <header className={classes.header}>
        <h1>ReactMeals</h1>
        <button onClick={() => postHandler}>Temp button</button>
        <HeaderCartButton />
      </header>
      <div className={classes["main-image"]}>
        <img src={mealsImage} alt='meals image'/>
      </div>
    </Fragment>
  );
}

export default Header;
